My latest “Trash To Treasure” furniture makeover is up on YouTube. I used two design trends, ROMAN CLAY & ARCHED SHELVES, for inspo on this trashed armoire (make sure you swipe all the way trough for the BEFORE).

@dixiebellepaint Terra Clay Paint (Desert Tan) was the perfect medium to get that Roman Clay textured look. If you want to see the technique I used to apply the paint and how I built the arch for the book shelves, head over to YouTube and search “pretty distressed roman clay!”

